A few shots I captured while photographing an incredible scientific expedition in Italy where I had the opportunity to photograph some unique and fascinating research projects!  From documenting underwater volcanoes, to capturing experiments in action, it was truly a once-in-a-lifetime experience. Being able to combine my love for photography with the exploration of new discoveries and advancements in science was truly a dream come true. Thank you to the amazing team of scientists and researchers for allowing me to capture the essence of your groundbreaking work. Stay tuned for some of the incredible shots I captured on this unforgettable journey!

